// SPDX-License-Identifier: MIT
pragma solidity 0.8.10;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import './Router.sol';

contract IndexNFT is ERC721 {
    address minter;
    uint wei_index = 50000000000000000 wei;
    uint COMP_Index_value = 0.05 ether;
    uint SNX_Index_value = 0.05 ether;
    uint token_id = 0;
    uint minted_tokens = 0;
    address internal constant UNISWAP_ROUTER_ADDRESS = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D ;

    Router router = Router(UNISWAP_ROUTER_ADDRESS);
    ERC20 COMP_token = ERC20(0x61460874a7196d6a22D1eE4922473664b3E95270);
    ERC20 SNX_token = ERC20(0xC011a73ee8576Fb46F5E1c5751cA3B9Fe0af2a6F);
    ERC20 DAI_token = ERC20(0x4F96Fe3b7A6Cf9725f59d353F723c1bDb64CA6Aa);

    constructor() ERC721("Crypto Index", "CI") {
        minter = msg.sender;
    }

    function burnNFT(uint tokenId, bool convertToStableCoin) public {
        require(ownerOf(tokenId) == msg.sender, "Sender must be owner");
        require(COMP_token.balanceOf(address(this)) >= wei_index * minted_tokens, "Insuficient COMP");
        require(SNX_token.balanceOf(address(this)) >= wei_index * minted_tokens, "Insuficient SNX");
        if (convertToStableCoin) {
            swapSNXToDAI();
            swapCOMPToDAI();
        } else {
            COMP_token.transfer(ownerOf(tokenId), COMP_Index_value);
            SNX_token.transfer(ownerOf(tokenId), SNX_Index_value);
        }
        _burn(tokenId);
        minted_tokens -= 1;
    }

    function mint() public {
        require(COMP_token.balanceOf(address(this)) >= wei_index * (minted_tokens + 1), "Needs COMP");
        require(SNX_token.balanceOf(address(this)) >= wei_index * (minted_tokens + 1), "Needs SNX");
        require(msg.sender == minter, "Sender must be the minter");
        _mint(msg.sender, token_id);
        token_id += 1;
        minted_tokens += 1;
    }

    function swapSNXToDAI() private {
        address[] memory path = new address[](3);
        path[0] = address(SNX_token);
        path[1] = router.WETH();
        path[2] = address(DAI_token);

        SNX_token.approve(address(router), wei_index);

        router.swapExactTokensForTokens(
            wei_index,
            0,
            path,
            msg.sender,
            block.timestamp + 20
        );
    }

    function swapCOMPToDAI() private {
        address[] memory path = new address[](3);
        path[0] = address(COMP_token);
        path[1] = router.WETH();
        path[2] = address(DAI_token);

        COMP_token.approve(address(router), wei_index);

        router.swapExactTokensForTokens(
            wei_index,
            0,
            path,
            msg.sender,
            block.timestamp
        );
    }

    function changeMinter(address newMinter) public {
        require(msg.sender == minter, "Sender must be the minter");
        minter = newMinter;
    }
}
